import React from "react";

function Header() {
  return (
    <nav>
      <li>
        <a href="/">Main</a>
      </li>
      <li>
        <a href="/about">About</a>
      </li>
      <li>
        <a href="/users">Users</a>
      </li>
    </nav>
  );
}

export default Header;
